import React from 'react';

const Image = () => {
    return (
        <div>
            <a href="http://www.whereintheworldistosh.com/2020/12/30/how-to-spend-one-day-exploring-gdansk-poland"
               target="_blank">
                <img src="/gdansk.jpg" alt="Gdansk"/>
            </a>

            <div>
                <button id="addImage">Додати</button>
                <button id="increaseSize">Збільшити</button>
                <button id="decreaseSize">Зменшити</button>
                <button id="removeImage">Видалити</button>
            </div>
        </div>
    );
};

export default Image;
